import React from "react";
import Header from "./Header";
import "bootstrap/dist/css/bootstrap.min.css";
import "../components/CSS/Style.css";
import Home from "./Home";
import Contact from './Contact'
const App = () => {
  return (
    <>
      <Header />
      <Home />
      <About/>
      <Contact />
    </>
  );
};

export default App;
